$.Each=function(f,g){var a={first:true,last:false};var d=$.Typeof(f);if(d=="array"){for(var c=0;c<f.length;c++){a={first:c==0,last:c==f.length-1};if(g(f[c],c,a)===false){break}}}else{if(d=="object"){var b=0;for(var c in f){b++}var e=0;for(var c in f){a={first:e==0,last:e==b-1};if(g(f[c],c,a)===false){break}e++}}else{g(f,0,{first:true,last:true})}}};